const apiKey = 'SgE0jUZXvAFlEH4zRDhMow5rEky23Kpy';
const peticion = fetch(`https://api.giphy.com/v1/gifs/random?api_key=${apiKey}`)

peticion.then( (resp) => {
    //esto resuelve la respuesta que proviene del api
    resp.json().then( data => {
        console.log(data)
    })
.catch(console.warn)
})
